BEGIN;
UPDATE
  youtube_stats.api_key_quota
SET
  api_key_quota = 0,
  api_key_restart_date = now()::timestamptz
WHERE
  (EXTRACT(HOUR FROM now()) > 6 AND (now()::DATE - api_key_restart_date::DATE) >= 1) OR
  (EXTRACT(HOUR FROM now()) <= 6 AND ((now() - INTERVAL '1 days')::DATE - api_key_restart_date::DATE) >= 1);
COMMIT;

